import React from "react"

function TrackingResult({ events }) {
  console.log(events, 'AQUI')

  if (!events || events.length === 0) return null;

  return (
    <>
      <h1>Result</h1>
      <ul className="list-group">
        {events.map(item => {

          return (
          <pre>{item}</pre>
          )
        })}
      </ul>
    </>
  )
}

export default TrackingResult
